import React, { Component } from 'react'

export class UserGreetings extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             isLoggedIn: false
        }
    }

  render() {
    return (
      <div>
            <div>Welcome Leela</div>
            
      </div>
    )
  }
}

export default UserGreetings
